  return (
    <div>
      <Hero title={props.title}></Hero>
      <div class="container">
        <form onSubmit="handleSubmit">
          <div class="form-group">
            <input
              type="text"
              onChange={handleChange}
              className="form-control mt-10"
              placeholder="search for books"
              autoComplete="off"
            />
            <br></br>
            <button type="submit" className="btn btn-danger">
              search
